import React, { Component } from 'react';


class Secomd extends Component {

    constructor(props) {
        super(props)

        this.state = {
            name: "navid"
        }   
    }




    hendal() {
        this.setState({
            name: "rafik bhai"
        })
    }

    render() {
        return (
            <div>
                <h1>{this.state.name}</h1>
                <button onClick={this.hendal()}>click me!</button>

            </div>
        );
    }
}

export default Secomd;
